import React from 'react';

class Card extends React.Component{
    render() {
        return(
            <div className={"card col-xl-3 col-lg-4 col-sm-6 box"}>
                <div className={"shadow_box"}>
                    <div className={"price"}>
                        <img src={this.props.main_image}/>
                        <p>huu</p>

                    </div>

                </div>

            </div>
        )
    }

}

export default Card;


